  <figcaption><span class="bold">Figura 1.5.</span> Típico conversor em quatro etapas produzido pela empresa Monsanto Co, adaptado (SHREVE; BRINK, 1997). <br> A - Catalisador de vanádio; B - visor; q - suporte de quartzo.</figcaption>
</figure>
<!-- FAZER CLASSE PARA BOX -->
<div class="box">
  <p>Para se produzir uma tonelada de ácido sulfúrico 100% são necessários: 30 kg de enxofre; ~ <span class="nobreak">27 m<sup>3</sup></span> de água; um gasto em termos de eletricidade da ordem de 10 kWh; consumo de vapor de 1.000 kg; uma mão-de-obra de 0,18 homens-hora e finalmente um custo de aproximadamente 5% do capital.</p>
</div>
<p>No conversor de quatro etapas, cada estágio apresenta quantidades distintas de catalisador, assim temos:</p>
<ul class="indentacao">
  <li><span class="bold">1 estágio – </span> 19% de catalisador – conversão aproximada de 56%;</li>
  <li><span class="bold">2 estágio – </span> 25% de catalisador – conversão aproximada de 87%;</li>
  <li><span class="bold">3 estágio – </span> 26,7% de catalisador – conversão aproximada de 99,1% e finalmente no último estágio – 28,9% de catalisador – conversão aproximada de 99,7%.</li>
</ul>

<h3>Absorvedores de SO<sub>3</sub></h3>
<p>Não se pode absorver o trióxido de enxofre em água, pois o contato entre essas duas substâncias produz uma névoa ácida difícil de ser absorvida. É de conhecimento notório que o ácido sulfúrico com concentração de 98,5-99,0% é o agente mais eficiente para a absorção de trióxido de enxofre. Antes de o gás ser expelido para o ambiente ele passa por um sistema com absorvedores de <span class="nobreak">SO<sub>3</sub></span> contendo esse ácido. A reação química a seguir representa essa etapa do processo:</p>
<div class="box-centro">
  <div class="formula">
    <div class="line">
      <p>H<sub>2</sub>SO<sub>4</sub>(l) + SO<sub>3</sub>(g) ⇌ H<sub>2</sub>S<sub>2</sub>O<sub>7</sub>(l)</p>
      <span class="box-eq">equação 1.13</span>
    </div>
  </div>
</div>

<p>Que reage com a água formando ácido sulfúrico concentrado:</p>
<div class="box-centro">
  <div class="formula">
    <div class="line">
      <p>H<sub>2</sub>S<sub>2</sub>O<sub>7</sub>(l) + H<sub>2</sub>O(l) ⇌ 2H<sub>2</sub>SO<sub>4</sub>(l)</p>
      <span class="box-eq">equação 1.14</span>
    </div>
  </div>
</div>


<p>A Figura 1.6 ilustra um típico eliminador de névoa do tipo Brink feito em fibra de vidro. Esse equipamento é usado nas indústrias de ácido sulfúrico durante o processo de concentração do ácido e nos fumos da chaminé.</p>
